import styled from "styled-components"

export const Button = styled.button`
  height: 40px;
  background-color: #f2ee6d;
  color: white;
  font-size: 16px;
  border-radius: 15px;
  cursor: pointer;
  padding: 12px 20px;
  border: none;
`
